import './App.css';
import Navbar from './Components/Navbar';
import Footer from './Components/Footer';
import HomeTop from './Components/HomeTop';

function App() {
  return (
    <div className="App">
     <Navbar/>
     <HomeTop />
     <Footer/>
    </div>
  );
}

export default App;
